import React from 'react';
import Layout from '../components/layout';
const Distinct = () => {
    return (
        <div>
        <Layout>
        <h1 className="d-flex justify-content-center">Bazy danych,systemy zarządzania <br/>-------bazą danych(dbms)-------</h1>
        <div id="content"><div id="page">
    <div className="content" id="pageDescription"><p>&nbsp;</p>
          <p>1. Definicja Systemu Zarządzania Bazą Danych.<br />2. Z jakich elementów składa się System Baz Danych.<br />3. Czym charakteryzuje się architektura klient-serwer<br />4. Czym charakteryzuje się architektura 3-warstwowa<br />5. Na czym polega trwałość bazy danych<br />6. Co oznacza pojęcie "integralność bazy danych"<br />7. Na czym polega współdzielenie danych w bazie<br />8. Co oznacza pojęcie "abstrakcja danych w bazie"<br />9. Na czym polega niezależność danych w bazie</p>
          <p>&nbsp;<img style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src="data:image/png;base64," alt="" /></p>
          <p>&nbsp;</p>
          <p>Do obsługi baz danych tworzone są złożone systemy zawierające zbiory gotowych narzędzi zapewniających dostęp do danych. Umożliwiają one manipulowanie danymi zgromadzonymi w systemach komputerowych i aktualizowanie tych danych. Są to <strong>systemy zarządzania bazą danych</strong>, w skrócie nazywane <strong>SZBD</strong> (ang. <strong>Database Management Systems</strong>).</p>
          <p><br />Do najważniejszych cech SZBD można zaliczyć:</p>
          <ul>
            <li><strong>operowanie na dużych i bardzo dużych zbiorach danych</strong></li>
            <li><strong>zarządzanie złożonymi strukturami.</strong></li>
          </ul>
          <p><br /><br /></p>
          <p className="ramka1"><strong>Architektura systemu baz danych</strong></p>
          <p><br />System zarządzania bazą danych wraz z bazami danych i językiem komunikowania się tworzą <strong>system baz danych</strong>.</p>
          <p>&nbsp;</p>
          <p><img style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src="data:image/png;base64," alt="" /></p>
          <p>&nbsp;</p>
          <p><br /><br />Interakcja programu użytkowego (aplikacji) z bazą danych odbywa się najczęściej za pomocą języka SQL. <strong>Jest to jedyny sposób komunikowania się aplikacji z bazą danych</strong>.</p>
          <p>Język SQL jest narzędziem dostępu do bazy danych stosowanym głównie przez projektantów aplikacji, projektantów baz danych i administratorów baz danych. Użytkownicy komunikują się z bazą danych za pomocą aplikacji i dopiero aplikacje komunikują się z bazą danych za pomocą poleceń SQL.</p>
          <p><br />W praktyce stosuje się dwa sposoby komunikacji z bazą danych:</p>
          <ul>
            <li><strong>architektura klient-serwer</strong></li>
            <li><strong>architektura 3-warstwowa</strong></li>
          </ul>
          <p>&nbsp;</p>
          <p><strong>Architektura klient-serwer</strong></p>
          <p>W architekturze klient-serwer aplikacje zainstalowane na stacjach użytkowników komunikują się z bazą danych, wykorzystując sieciowe oprogramowanie dedykowane do komunikacji z systemem zarządzania bazą danych.</p>
          <p>&nbsp;</p>
          <p><img style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src="data:image/jpeg;base64," alt="" /></p>
          <p>&nbsp;</p>
          <p><strong>Architektura 3-warstwowa</strong></p>
          <p>W architekturze 3-warstwowej pomiędzy użytkownikami a serwerem bazy danych znajduje się tzw. serwer aplikacji, który udostępnia umieszczone na nim aplikacje. Jest to architektura typowa dla aplikacji WWW. Aplikacje są udostępniane przez serwer aplikacji w postaci stron internetowych. Użytkownik komunikuje się z bazą danych przez przeglądarkę stron WWW. W odpowiedzi na polecenia użytkownika serwer aplikacji wysyła odpowiednie żądania do systemu zarządzania bazą danych, który wykonuje polecenia i przesyła ich wyniki do serwera aplikacji. Serwer aplikacji przesyła te wyniki do aplikacji użytkownika.</p>
          <p><img style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src="data:image/png;base64," alt="" /><br /><br /></p>
          <p className="ramka1"><strong>Baza danych</strong></p>
          <p><br />Baza danych to zbiór danych z określonej dziedziny posiadający ściśle zdefiniowaną wewnętrzną strukturę. Baza danych powinna charakteryzować się następującymi cechami:</p>
          <ul>
            <li><strong> trwałość danych</strong></li>
            <li><strong>integralność danych</strong></li>
            <li><strong>bezpieczeństwo danych</strong></li>
            <li><strong>współdzielenie danych</strong></li>
            <li><strong>abstrakcja danych</strong></li>
            <li><strong>niezależność danych</strong></li>
            <li><strong>integracja danych</strong></li>
          </ul>
          <p>&nbsp;</p>
          <p><strong>Trwałość</strong></p>
          <p>Trwałość danych zapisanych w bazie jest podstawową cechą baz danych. Trwałość danych oznacza, że dane zostały zapisane w bazie w sposób nieulotny. Wszystkie współczesne systemy baz danych muszą spełniać ten wymóg. Trwałość danych jest niezależna od działania aplikacji oraz od platformy sprzętowej i programowej. Dane gromadzone w bazie danych są przechowywane w pamięci zewnętrznej (dyskowej, optycznej, taśmowej). Powinny one być przechowywane w pamięci tak długo, jak długo wymagają tego użytkownicy systemu baz danych.</p>
          <p><br /><strong>Integralność, czyli poprawność danych</strong></p>
          <p>Integralność (spójność) danych oznacza, że dane muszą:</p>
          <ul>
            <li>wiernie odzwierciedlać dane rzeczywiste,</li>
            <li>spełniać ograniczenia nałożone przez użytkowników,</li>
            <li>wykazywać brak anomalii wynikających ze współbieżnego dostępu do danych.</li>
          </ul>
          <p>Integralność bazy danych to także odporność na błędy i awarie wynikające z zawodności sprzętu i oprogramowania oraz odporność na błędy użytkowników.</p>
          <p>Wyróżniamy dwa rodzaje integralności danych:</p>
          <ul>
            <li><strong>semantyczna</strong> — oznacza zgodność danych z rzeczywistością, czyli poprawność odwzorowania rzeczywistości;</li>
            <li><strong>bazowa</strong> — oznacza poprawność procesów zachodzących w bazie.</li>
          </ul>
          <p>Na poziomie struktur bazy danych można wyróżnić następujące rodzaje integralności:</p>
          <ul>
            <li><strong>referencyjna</strong> — oznacza, że każdej wartości klucza obcego odpowiada dokładnie jedna wartość klucza podstawowego;</li>
            <li><strong>encji</strong> — oznacza, że każdy atrybut encji musi mieć określoną wartość;</li>
            <li><strong>atrybutu</strong> — oznacza, że wartość każdego atrybutu należy do jego dziedziny.</li>
          </ul>
          <p><br /><br /><strong>Bezpieczeństwo danych</strong></p>
          <p>Bezpieczeństwo danych oznacza, że dostęp do bazy danych mają tylko jej użytkownicy identyfikowani unikalną nazwą (loginem) i hasłem. Ponadto każdy użytkownik posiada określone uprawnienia w bazie danych. Bezpieczeństwo danych oznacza również, że baza danych jest zabezpieczona przed awarią sprzętu lub oprogramowania.</p>
          <p><br /><br /><strong>Współdzielenie danych</strong></p>
          <p>Współdzielenie danych oznacza, że istnieje możliwość równoczesnej pracy wielu użytkowników z tą samą bazą danych. Użytkownicy mogą też jednocześnie pracować z tym samym zbiorem danych. Skutkiem takiej pracy mogą być konflikty w dostępie do danych, gdy jeden użytkownik modyfikuje zbiór danych, a drugi próbuje ten sam zbiór odczytać lub zmodyfikować w inny sposób. W bazie danych muszą istnieć mechanizmy zapewniające poprawne rozwiązanie takich konfliktów.</p>
          <p><br /><br /><strong>Abstrakcja danych</strong></p>
          <p>Baza danych zawiera pewien model rzeczywistości. Ale przechowywane są w niej tylko niektóre dane o obiektach. Powinny one opisywać wyłącznie istotne aspekty obiektów świata rzeczywistego. Baza danych to abstrakcyjny model pewnego wycinka rzeczywistości, a jej struktura powinna w poprawny sposób odzwierciedlać obiekty świata rzeczywistego i powiązania pomiędzy tymi obiektami.</p>
          <p><br /><br /><strong>Niezależność danych</strong></p>
          <p>Niezależność danych polega na oddzieleniu danych od aplikacji, które używają tych danych. Niezależność danych może być rozpatrywana w dwóch aspektach:</p>
          <ul>
            <li><strong>Logiczna niezależność danych</strong> — niezależność danych widzianych przez użytkownika (przez jego aplikacje) od logicznej struktury bazy danych (schematu pojęciowego) oraz zmian tej struktury w czasie.</li>
            <li><strong>Fizyczna niezależność danych</strong> — niezależność logicznej struktury bazy danych (schematu pojęciowego) od sposobu przechowywania danych w pamięci zewnętrznej (na nośnikach zewnętrznych).</li>
          </ul>
          <p>We współczesnych bazach danych niezależność danych jest osiągana tylko częściowo.</p>
          <p><br /><br /><strong>Integracja danych</strong></p>
          <p>Integracja danych polega na zapewnieniu współpracy danych przechowywanych w różnych miejscach i obsługiwanych przez różne systemy. Często bazy danych fizycznie są umieszczane na różnych komputerach połączonych ze sobą w taki sposób, że użytkownik nie wie, iż dane, z którymi pracuje, pochodzą z różnych baz i komputerów. Zmiany zawartości bazy na jednym komputerze powinny być uwzględniane również na innych komputerach. Tak funkcjonujące bazy nazywamy rozproszonymi bazami danych. Bazy danych powinny być zaprojektowane tak, aby dane były zawsze dostępne, niezależnie od tego, gdzie i w jakiej postaci zostały zapisane i jak są przechowywane. Serwery bazodanowe powinny zapewniać integrację rozproszonych danych znajdujących się na wielu komputerach. Mechanizmy integracyjne dostępne na nich powinny działać w czasie rzeczywistym i współpracować z różnorodnymi bazami danych.</p>
          <p>&nbsp;</p>
          <p className="ramka1"><strong>System zarządzania bazą danych</strong></p>
          <p><br />System zarządzania bazą danych (ang. Database Management System — DBMS) decyduje o sposobie pobierania i przechowywania danych w relacyjnych bazach danych. Może on udostępniać bazę lokalnie na jednym komputerze (bazy jednostanowiskowe) lub może być serwerem bazy danych udostępniającym zasoby komputerom połączonym w sieć (bazy typu klient-serwer).</p>
          <p>System zarządzania bazą danych musi posiadać mechanizmy, które pozwalają administrować zbiorami danych umieszczonymi w bazie, zapewniają bezpieczeństwo i integralność danych, umożliwiają dostęp do danych za pomocą języka zapytań (najczęściej SQL), zapewniają wielodostępność danych (na przykład przez transakcje) oraz pozwalają na autoryzację dostępu do danych.</p>
          <p>Często takie systemy posiadają narzędzia do przechowywania i przetwarzania danych multimedialnych, narzędzia do konwersji danych w celu współpracy z innymi systemami baz danych, graficzne środowiska do tworzenia aplikacji oraz narzędzia do udostępniania bazy danych w internecie.</p>
          <p>W systemach zarządzania bazą danych można wyodrębnić dwa elementy:</p>
          <ul>
            <li><strong>serwer</strong> — przechowuje dane, umożliwia ich pobieranie i aktualizowanie oraz zapewnia ich integralność i bezpieczeństwo;</li>
            <li><strong>oprogramowanie pośredniczące</strong> (ang. middleware) — realizuje komunikację między użytkownikiem a serwerem. Wyposażone jest w mechanizmy pozwalające wykorzystywać pobierane dane, na przykład w narzędzia do tworzenia i obsługi formularzy oraz raportów.</li>
          </ul>
          <p>Systemy zarządzania bazą danych zwykle działają w trybie klient-serwer, czyli baza umieszczona na serwerze jest udostępniana klientom poprzez oprogramowanie pośredniczące (systemy bazodanowe). Przykładami takich systemów są:<strong> MySQL, MS SQL Server, Oracle, PostgreSQL, DB2</strong>.<br />Istnieją również systemy, które nie uwzględniają podziału typu klient-serwer. Przykładem takiego systemu jest <strong>Microsoft Access</strong>.</p>
          <p>System zarządzania bazą danych (serwer bazodanowy), który należy do architektury klient-serwer, składa się z dwóch części, które ze sobą współpracują. Jedna część, działająca na serwerze, odpowiedzialna jest za wydajność, bezpieczeństwo, kopie zapasowe itp. Druga, działająca po stronie klienta, zapewnia interfejs użytkownika, dzięki któremu możliwe jest przeprowadzanie operacji na bazie danych. Najczęściej serwer bazodanowy komunikuje się z bazą danych za pomocą języka SQL<br /><br /><br /><br /><br /><strong>Schemat SZBD</strong></p>
          <p>Schemat systemu zarządzania bazą danych wraz z otaczającym go środowiskiem został pokazany popniżej.</p>
          <p>&nbsp;</p>
          <p><img style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src="data:image/png;base64," alt="" /></p>
          <p>&nbsp;</p>
          <ul>
            <li><strong>Moduł zarządzania pamięcią</strong> przechowuje informacje o miejscu zapisania plików bazy danych na dysku oraz obsługuje pamięć operacyjną.</li>
            <li><strong>Procesor zapytań</strong> przekształca zapytanie lub operację języka zapytań w ciąg poleceń żądających określonych danych.</li>
            <li><strong>Moduł zarządzania transakcjami</strong> kontroluje poprawność i kompletność wykonania wszystkich transakcji.</li>
          </ul>
          <p>&nbsp;</p></div></div>
     
    </div>
        </Layout>

        </div>
    );
}

export default Distinct;
